import React from 'react';
import {Link} from 'react-router-dom'

const MainMenu = () => {
    return (
        <header>
            <ul>
                <li>
                    <Link to={"/"}>Home</Link>
                </li>
                <li>
                    <Link to={"/profile"}>About</Link>
                </li>
            </ul>
        </header>
    );
};

export default MainMenu
